import React from "react";
import "../index.css";

const Banner = () => {
  return (
    <div className="banner">
      <img
        src={require("../img/img/banner.jpg")}
        className="img-fluid"
        alt="К весне готовы!"
      />
      <h2 className="banner-header">К весне готовы!</h2>
    </div>
  );
};

export default Banner;
